import React from "react";
const Home = () => {
  const container = {
    display: "flex",
    alignItem: "center",
    justifyContent: "spaceBetween",
  };
  const btn = {
    width: "250px",
    height: "30px",
    textAlign: "center",
    backgroundColor: "lightyellow",
  };
  return (
    <>
      <div style={container}>
        <h1>Welcome to Login Page</h1>
        <button style={btn}>Login</button>
        <h1></h1>
      </div>
    </>
  );
};
export default Home;
